  return (
    <div className="email">
      <label>E-mail</label>
      <input
        className={emailState.isValid === false ? "emailInvalid" : ""}
        onChange={emailChangeHandler}
        onBlur={emailValidator}
      ></input>
    </div>
  );
}

export default inputs;
